import React from "react";
import "./animeHome.css";
import $ from "jquery";
// import AnimeSidebar from "../components/sidebars/AnimeSidebar";
// import Navbar from "../components/navbar/Navbar";

const AnimeHome = () => {
  $(function () {
    $(".class").click(function () {
      alert("Anime");
    });
  });

  return ;
};

export default AnimeHome;
